import React from 'react';
import { Container, Row, Col, Image } from 'react-bootstrap';

function Board() {
  return (
    <Container>
      <Row className="d-flex justify-content-center">
        
        <Col md={1} lg={1} xl={1}></Col>

        <Col xs={12}  md={10} lg={10} className="d-flex justify-content-center mb-4">
          <Image 
            src="https://www.junaidjamshed.com/media/wysiwyg/banner_29.jpg" 
            alt="Responsive Image" 
            fluid 
            style={{ height: '350px', width: '1400px' }}
          />
        </Col>
        <Col md={1} lg={1} xl={1}></Col>
      </Row>
    </Container>
  );
}

export default Board;
